import testImage from "../svg/test.svg";

const DetailedForecast = () => {
    return (  
        <div>
            <h2>Air Conditions</h2>

            <div>
                {/* real feel */}
                <div>
                    <img src={testImage} alt="icon not found" />
                    <h5>Real Feel</h5>
                    <h1>30째</h1>
                </div>

                {/* wind */}
                <div>
                    <img src={testImage} alt="icon not found" />
                    <h5>Wind</h5>
                    <h1>30째</h1>
                </div>

                {/* chance of rain */}
                <div>
                    <img src={testImage} alt="icon not found" />
                    <h5>Chance of Rain</h5>
                    <h1>30째</h1>
                </div>

                {/* UV index */}
                <div>
                    <img src={testImage} alt="icon not found" />
                    <h5>UV Index</h5>
                    <h1>30째</h1>
                </div>
            </div>
        </div>
    );
}
 
export default DetailedForecast;
